import React from 'react';

import './Navbar.css';
import { Link } from 'react-router-dom';

const Navbar = () => (
  <div className='cv__navbar'>
    <div className='heading'>
      <div></div>
      <Link to='/'>Name</Link>
    </div>
  </div>
);

export default Navbar;
